function mipl_sl_init_single_stockist_map(e){if("mipl-sl-google-map"==e){var o=parseFloat(jQuery("#mipl_sl_single_store_latitude").val()),l=parseFloat(jQuery("#mipl_sl_single_store_longitude").val()),i=jQuery("#mipl_sl_single_marker").val();$default_zoom=12,$mipl_stockist_google=new google.maps.Map(document.getElementById("mipl_sl_single_store_map"),{zoom:$default_zoom,center:{lat:o,lng:l},zoomControl:!0}),$mipl_mapl_marker=new google.maps.Marker({position:{lat:o,lng:l},map:$mipl_stockist_google,animation:google.maps.Animation.DROP,icon:i}),google.maps.event.addListener($mipl_mapl_marker,"mouseover",(function(){$mipl_mapl_marker.setAnimation(google.maps.Animation.BOUNCE)})),google.maps.event.addListener($mipl_mapl_marker,"mouseout",(function(){$mipl_mapl_marker.setAnimation(null)})),google.maps.event.addListener($mipl_mapl_marker,"click",(function(){window.open("https://maps.google.com?saddr=Current+Location&daddr="+o+","+l)}))}}jQuery(document).ready((function(){mipl_sl_init_single_stockist_map(jQuery(".mipl_sl_single_store_container").attr("data-provider"))}));